import Sidebar from './components/Sidebar';
import './App.css';
import {Routes, Route } from "react-router-dom";
import Login from './components/Login'

function App() {
  return (
    <div>
      <Routes>
        <Route path='/' element={<Sidebar />} />
        <Route path='/login' element={<Login />} />
      </Routes>
      {/* <Sidebar /> */}
    </div>
  );
}

export default App;
